import React from 'react';

function Register() {
  return (
    <div className="auth"> 
      <div className="auth__container">
        <h2 className="auth__title">Регистрация</h2>
        <form className="auth__form" action="#" noValidate>
          <label>
            <input type="text" defaultValue="" className="auth__item auth__item_type_email" name="email" placeholder="Email" required minLength="2" maxLength="40" />
            <span id="email-error" className="auth__item-error"></span>
          </label>
          <label>
            <input type="password" defaultValue="" className="auth__item auth__item_type_password" name="password" placeholder="Пароль" required minLength="2" maxLength="200" />
            <span id="password-error" className="auth__item-error"></span>
          </label>
          <button type="submit" className="auth__button">Зарегистрироваться</button>
        </form>
        <p>Уже зарегистрированы?<Link to="">Войти</Link></p>
      </div>
    </div> 
  );
}

export default Register;
